    public function buscarAsientos()
    {

        try {
            $numpartida = $this->input->post('partida') != null ? $this->input->post('partida') : null;
            $numregistro = $this->input->post('numregistro') != null ? $this->input->post('numregistro') : null;
            $oficina = $this->input->post('oficina') != null ? $this->input->post('oficina') : null;

            $numzona = json_decode(CONSULTA_OFICINA)->$oficina;
            $numzona = $numzona[0];
            $numoficina= json_decode(CONSULTA_OFICINA)->$oficina;
            $numoficina = $numoficina[1];

            
            /*
            $context = stream_context_create(array('https' => array('header' => 'Accept: application/xml')));
            $url = 'https://ws3.pide.gob.pe/Rest/Sunarp/ListarAsientos?zona='.$numzona.'&oficina='.$numoficina.'&partida='.$numpartida.'&registro='.$numregistro;
            $xml = file_get_contents($url, false, $context);*/
              
            $doc = new DOMDocument();

            $xml = '
                <soapenv:envelope xmlns:soapenv="http://schemas.xmlsoap.org/soap/envelope/">
                <soapenv:body>
            <rpcop:listarasientosresponse 
            xmlns:rpcop="http://controller.pide.sunarp.gob.pe/" 
            xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance">
            <asientos>
            <transaccion>58401813</transaccion>
            <nrototalpag>3</nrototalpag>

            <listasientos>
            <idimgasiento>57792765</idimgasiento>
            <numpag>1</numpag>
            <tipo>ASIENTO</tipo>
            <listpag>
            <nropagref>3</nropagref>
            <pagina>1</pagina>
            </listpag>
            </listasientos>
            <listasientos>
            <idimgasiento>55897099</idimgasiento>
            <numpag>2</numpag>
            <tipo>ASIENTO</tipo>
            <listpag>
            <nropagref>1</nropagref>
            <pagina>1</pagina>
            </listpag>
            <listpag>
            <nropagref>2</nropagref>
            <pagina>2</pagina>
            </listpag>
            </listasientos>
            </asientos>
            </rpcop:listarasientosresponse>
            </soapenv:body>

            </soapenv:envelope>
            ';

            $xml = preg_replace('/&(?!#?[a-z0-9]+;)/', '&amp;', $xml);



            $doc->preserveWhiteSpace = false;
            $doc->loadXML($xml);
            $i = 0;
            $transaccion=$doc->getElementsByTagName('transaccion')->item(0)->nodeValue;
            $totalpag= $doc->getElementsByTagName('nrototalpag')->item(0)->nodeValue;

            $usuario = $this->session->userdata('s_nombreUsuario');
            $ip = $this->input->ip_address();
            $consulta = "CONSULTA PIDE TITULARIDAD JURIDICA - ASIENTOS";
            $entrada= "transacción :".$transaccion.",partida :".$numpartida.",numero de registro:".$numregistro.", oficina:".$oficina;

            $datos_pide = array(
                'USUARIO'          => $usuario,
                'TXTIPCONSULTA'      => $ip,
                'TXTCONSULTAPIDE'         => $consulta,
                'DATOSENTRADA'     => $entrada,
                'DATOSSSALIDA'           => strval($xml)
            );

            $data = $this->M_utils->insertarPideConsulta($datos_pide);
            $busqueda =  $data['codigo'];
            
            $data['html'] = '
            <b><span style="color:#063f5d;">Código de Búsqueda: </span></b><span  style="text-transform: capitalize">' . $busqueda. '</span></span><br> 

            <b><span style="color:#063f5d;">Transacción: </span></b><span id="transaccion" style="text-transform: capitalize">' . $transaccion. '</span></span><br> 
            <b><span style="color:#063f5d;">Total de Páginas: </span></b><span id="totalpag" style="text-transform: capitalize">' .$totalpag . '</span></span><br><br>              
            
            ';

           
            $selectRef  = '';
            $selectFoto  = '';
            

            while ($sunarp = $doc->getElementsByTagName("listasientos")->item($i)) {

                $idimagen = $sunarp->getElementsByTagName('idimgasiento')->item(0);
                isset($idimagen) ? $idimagen = $idimagen->nodeValue : $idimagen = "--";

                $numpag = $sunarp->getElementsByTagName('numpag')->item(0);
                isset($numpag) ? $numpag = $numpag->nodeValue : $numpag = "--";
                
                $tipo = $sunarp->getElementsByTagName('tipo')->item(0);
                isset($tipo) ? $tipo = $tipo->nodeValue : $tipo = "--";
                $j = 0;
                
                while ($list = $sunarp->getElementsByTagName("listpag")->item($j)) {

                    $ref = $list->getElementsByTagName('nropagref')->item(0);
                    isset($ref) ? $ref = $ref->nodeValue : $ref = "";    

                    $pagina = $list->getElementsByTagName('pagina')->item(0);
                    isset($pagina) ? $pagina = $pagina->nodeValue : $pagina = "--";
                    
                    $selectRef .= '<option value="'.$transaccion.'|'.$totalpag.'|'.$ref.'|'.$pagina.'|'.$idimagen.'" class="ASIENTO" style="display:none">'.$ref.'</option>';
                   
                    $j++;
                }
                $i++;
            }
            $i = 0;
            while ($sunarp = $doc->getElementsByTagName("listfichas")->item($i)) {
                $idimgficha = $sunarp->getElementsByTagName('idimgficha')->item(0);
                isset($idimgficha) ? $idimgficha = $idimgficha->nodeValue : $idimgficha = "--";

                $numpag = $sunarp->getElementsByTagName('numpag')->item(0);
                isset($numpag) ? $numpag = $numpag->nodeValue : $numpag = "--";

                $tipo = $sunarp->getElementsByTagName('tipo')->item(0);
                isset($tipo) ? $tipo = $tipo->nodeValue : $tipo = "--";
                $j = 0;
                
                while ($list = $sunarp->getElementsByTagName("listpag")->item($j)) {

                    $ref = $list->getElementsByTagName('nropagref')->item(0);
                    isset($ref) ? $ref = $ref->nodeValue : $ref = "";

                    $pagina = $list->getElementsByTagName('pagina')->item(0);
                    isset($pagina) ? $pagina = $pagina->nodeValue : $pagina = "--";

                    $selectRef .= '<option value="'.$transaccion.'|'.$totalpag.'|'.$ref.'|'.$pagina.'|'.$idimgficha.'" class="FICHA" style="display:none">'.$ref.'</option>';
                   
                    $j++;
                }
                $i++;
            }
            $i = 0;
            while ($sunarp = $doc->getElementsByTagName("listfolios")->item($i)) {

                $idimgfolio = $sunarp->getElementsByTagName('idimgfolio')->item(0);
                isset($idimgfolio) ? $idimgfolio = $idimgfolio->nodeValue : $idimgfolio = "--";

                $tipo = $sunarp->getElementsByTagName('tipo')->item(0);
                isset($tipo) ? $tipo = $tipo->nodeValue : $tipo = "--";
                          
                $ref = $sunarp->getElementsByTagName('nropagref')->item(0);
                isset($ref) ? $ref = $ref->nodeValue : $ref = "";    

                $pagina = $sunarp->getElementsByTagName('pagina')->item(0);
                isset($pagina) ? $pagina = $pagina->nodeValue : $pagina = "--"; 
                
                $selectRef .= '<option value="'.$transaccion.'|'.$totalpag.'|'.$ref.'|'.$pagina.'|'.$idimgfolio.'" class="FOLIO" style="display:none">'.$ref.'</option>';
               


                $i++;
            }
            $data['html'] .= '<div class="col-8">
                                <div class="form-group">
                                    <label for="selectTipo">TIPO</label>
                                    <select class="form-control" id="selectTipo" onchange="getReferencia()">
                                        <option value="">Seleccione un tipo</option>
                                        <option value="ASIENTO">ASIENTO</option>
                                        <option value="FICHA">FICHA</option>
                                        <option value="FOLIO">FOLIO</option>
                                    </select>
                                </div>
                            </div>';
            $data['html'] .= '<div class="col-8">
                                <div class="form-group">
                                    <label for="selectRef">Número de referencia</label>
                                    <select class="form-control" id="selectRef">
                                        <option value="">Seleccione un número de referencia</option>
                                        '.$selectRef.'
                                    </select>
                                </div>
                            </div>';
            $data['html'] .= '<input style="display:none;" type="text" id="idfoto"  value="'.$selectFoto.'"/>';

            $data['error'] = EXIT_SUCCESS;
           echo json_encode($data);
          
            
        } catch (\Throwable $th) {
            throw $th;
        }
    }


    public function VerAsiento()
