            $totalpag = $this->input->post('totalpag') != null ? $this->input->post('totalpag') : null;

         

            /*$context  = stream_context_create(array('https' => array('header' => 'Accept: application/xml')));
            $url = 'https://ws3.pide.gob.pe/Rest/Sunarp/VerAsientos?transaccion='.$transaccion.'&idImg='.$idimg.'&tipo='.$tipo.'&nroTotalPag='.$totalpag.'&nroPagRef='.$ref.'&pagina='.$numpag.'';
            $xml = file_get_contents($url, false, $context); */

            $xml = '
            <soapenv:Envelope xmlns:soapenv="http://schemas.xmlsoap.org/soap/envelope/">
            <soapenv:Body>
