                  <img> 
                  
                  
                  
                  
                  
                  
                  
                  
                  
                   
                  </img>
               </rpcOp:verAsientoResponse>
            </soapenv:Body>
         </soapenv:Envelope>
         ';
            $doc = new DOMDocument();
            
            $doc->loadXML($xml);
            $logodata = $doc->getElementsByTagName('img')->item(0)->nodeValue;


            $usuario = $this->session->userdata('s_nombreUsuario');
